import React, { Component } from 'react'

export default class ClassComponentExample extends Component {
    constructor(props){
        super(props);
        this.Student={
            Name:"Krishna",
            SurName:"Patidar"
        }
    }
  render() {
    return (
        <>
      <div>Class Component Example</div>
      <p>{this.Student.Name} {this.Student.SurName}</p>
      </>
    )
  }
}
